import React from 'react'
import ReactPlayer from 'react-player'



export const CopadamEpisodes = () => {




  return (
    
    
    <div>
        
        <ReactPlayer url={"/series/copadam/copadam1.mp4"}
                       controls
                       playing={true}
                       muted
                       width="1068px"
                       height="601px"
        />
        
    </div>
  )
}
